import React from 'react';
import Link from 'react-router-dom';

const NotFound = () => {
  return (
    <div>
      <h2>
        The video that you're looking for is unavailable in the data base.
      </h2>
      <Link to='/'>Back to Home</Link>
    </div>
  );
};

export default NotFound;
